# DO NOT edit this file by hand, qutebrowser will overwrite it.
# Instead, create a config.py - see :help for details.

config_version: 2
settings:
  aliases:
    global:
      q: close
      qa: quit
      w: session-save
      wc: config-write-py --force
      wq: quit --save
      wqa: quit --save
  colors.completion.scrollbar.fg:
    global: '#1F292E'
  colors.prompts.bg:
    global: '#1F292E'
  colors.statusbar.caret.bg:
    global: '#1F292E'
  colors.statusbar.command.bg:
    global: '#1F292E'
  colors.statusbar.command.private.bg:
    global: '#1F292E'
  colors.statusbar.insert.bg:
    global: '#1F292E'
  colors.statusbar.normal.bg:
    global: '#1F292E'
  colors.statusbar.passthrough.bg:
    global: '#1F292E'
  colors.statusbar.private.bg:
    global: '#1F292E'
  colors.tabs.bar.bg:
    global: '#1F292E'
  colors.tabs.even.bg:
    global: '#1F292E'
  colors.tabs.odd.bg:
    global: '#1F292E'
